import React from 'react';
import axios from 'axios';


class Index extends React.Component {

    state = {
        access_token : ''
    }

    componentDidMount(props) {
        var urlParams = new URLSearchParams(window.location.search);
        this.setState({
            access_token: urlParams.has('code')
        });

        console.log(this.state.access_token)


        axios.get('/user?ID=12345')
            .then(function (response) {
                // handle success
                console.log(response);
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            })
            .finally(function () {
                // always executed
            });

    }

    render() {
        return <a href="https://api.instagram.com/oauth/authorize?client_id=832162937288585&redirect_uri=https://bb5c8bc3.ngrok.io/&scope=user_profile,user_media&response_type=code"><span>Login with Instagram</span></a>;
    }
}

export default Index;
